import React from 'react';
import {AppBar, Toolbar, Typography, Grid, Button, Dialog, DialogTitle, DialogContent, TextField, DialogActions, DialogContentText} from '@material-ui/core';
import { makeStyles, ThemeProvider} from '@material-ui/core/styles';

const LoginButton = () => {

    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
        setOpen(true);
    };

      const handleClose = () => {
        setOpen(false);
    };

    return(
        <>
        <Button  
        style={{backgroundColor: "#262B3B", color: "#3485E4"}}
        boxShadow={3} 
        onMouseEnter={event=>{
            event.target.style.backgroundColor = "#3485E4" 
            event.target.style.color = "white"
        }}
        onMouseLeave={event=>{
            event.target.style.backgroundColor = "#262B3B"
            event.target.style.color = "#3485E4"
        }}
        onClick={handleClickOpen}
        >Log in</Button>
        <Dialog open={open} onClose={handleClose}>
        <DialogTitle id="save-form">Save Project</DialogTitle>
        <DialogContent>
        <DialogContentText>
          Please provide a Project Name
          so we can save your terrible code.
        </DialogContentText>
        <TextField
          autoFocus
          margin="dense"
          id="projectName"
          label="Project Name here..."
          type="email"
          fullWidth
          />
        </DialogContent>
        <DialogActions>
        <Button onClick={handleClose} color="primary">
          Cry
        </Button>
        <Button onClick={handleClose} color="primary">
          Save
        </Button>
      </DialogActions>
    </Dialog>
    </>
    );

}

export default LoginButton;
